// About.js
import React from "react";
import "./About.css";
const About = () => {
  return (
    <div className="two-column-container">
      <div className="column">
        <h1>Little Lemon</h1>
        <h2>Chicago</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin eget
          nulla magna. Phasellus sodales enim ut lorem vestibulum luctus. Fusce
          ullamcorper scelerisque mi, a lobortis lacus efficitur sed.
        </p>
      </div>
      <div class="image-stack">
        <div class="image-stack__item image-stack__item--top">
          <img
            src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/110238/texture-waves2.jpeg"
            alt="A portrait of a girl under hanging flowers."
          />
        </div>
        <div class="image-stack__item image-stack__item--bottom">
          <img
            src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/110238/portrait-1-cropped.jpg"
            alt=""
          />
        </div>
      </div>
    </div>
  );
};

export default About;
